import './App.css';

function App() {


  const onClickSubmit = (event) => {
    console.log(`Height: ${document.getElementById("form-height").value}`)
    console.log(`Weight: ${document.getElementById("form-weight").value}`)
  }

  return (
    <div className="App">
      <form>
        <input id='form-height' type="number" placeholder='height'></input>
        <input id='form-weight' type="number" placeholder='weight'></input>
        <button type="submit" onClick={onClickSubmit}>Calculate</button>
      </form>
    </div>
  );
}

export default App;
